import React from 'react';
import './Shop.css';
const Shop = () => {
    return (
        <div className='shop-container'>
            <div className="products-container">
            <h3>this is for products</h3>
            </div>
            <div className="cart-container">
            <h4>Order Summery</h4>
            </div>
        </div>
    );
};

export default Shop;
